import React from 'react'

const SchoolCard = (props) => {
    return (
        <div className="relative w-[542px] h-[400px]">
        <img
            alt=""
            className="absolute inset-0 w-[542px] h-[400px]"
            src={props.resData.attributes.PhotoUrl}
        />
        <div className='absolute bottom-0 bg-white w-[542px] h-[100px] rounder'>{props.resData.attributes.Title}</div>

        </div>
    );
}

export default SchoolCard
